    {id: 3, message: "Hello, friend"},
    {id: 4, message: "Hello, brother"},
    {id: 5, message: "Hello"},
    {id: 6, message: "Hello"}
]

const dialogData = [
    {id: 1, name: "Alex"},
    {id: 2, name: "Petya"},
    {id: 3, name: "Olga"},
    {id: 4, name: "Vanya"},
    {id: 5, name: "Petya"},
    {id: 6, name: "Tanya"}
]

const messagesData = [
    {id: 1, message: "Hello"},
    {id: 2, message: "No"},
    {id: 3, message: "Yes"},
    {id: 4, message: "Hello"},
    {id: 5, message: "No"},
    {id: 6, message: "Yes"}
]

const root = ReactDOM.createRoot(document.getElementById('root'));

root.render(
  <React.StrictMode>
    <App postData={postData} messagesData={messagesData} dialogData={dialogData}/>
  </React.StrictMode>
);

